    t[1509] = "\u062a\u0648\u0646\u0644 \u0645\u0634\u062a\u0631\u06cc \u0633\u0641\u0627\u0631\u0634\u06cc \u0645\u062e\u0635\u0648\u0635 \u0627\u062a\u0635\u0627\u0644\u0627\u062a IRC.";
    t[1514] = "With this tunnel type, IRC networks in I2P can be reached by typing the I2P address into your IRC client, and configuring the IRC client to use this SOCKS tunnel.";
    t[1515] = "\u0628\u0627 \u0627\u06cc\u0646 \u0646\u0648\u0639 \u062a\u0648\u0646\u0644\u060c \u0628\u0627 \u062a\u0627\u06cc\u067e \u0622\u062f\u0631\u0633 I2P \u062f\u0631 \u0633\u0631\u0648\u06cc\u0633 \u06af\u06cc\u0631\u0646\u062f\u0647 IRC \u0648 \u067e\u06cc\u06a9\u0631\u0628\u0646\u062f\u06cc \u0633\u0631\u0648\u06cc\u0633 \u06af\u06cc\u0631\u0646\u062f\u0647 IRC \u0628\u0631\u0627\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u062a\u0648\u0646\u0644 SOCKS\u060c \u0645\u06cc \u062a\u0648\u0627\u0646 \u0628\u0647 \u0634\u0628\u06a9\u0647 \u0647\u0627\u06cc IRC \u062f\u0631 I2P \u062f\u0633\u062a\u0631\u0633\u06cc \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f.";
    t[1520] = "When enabled, the accept headers (mime types support) broadcast by your web browser will not be filtered, potentially reducing your anonymity";
    t[1521] = "\u0648\u0642\u062a\u06cc \u0641\u0639\u0627\u0644 \u0628\u0627\u0634\u062f\u060c \u0647\u062f\u0631\u0647\u0627\u06cc \u067e\u0630\u06cc\u0631\u0634 (\u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0627\u0632 \u0627\u0646\u0648\u0627\u0639 mime) \u06a9\u0647 \u062a\u0648\u0633\u0637 \u0645\u0631\u0648\u0631\u06af\u0631 \u0648\u0628 \u0634\u0645\u0627 \u067e\u062e\u0634 \u0645\u06cc\u200c\u0634\u0648\u0646\u062f \u0641\u06cc\u0644\u062a\u0631 \u0646\u0645\u06cc\u200c\u0634\u0648\u0646\u062f \u0648 \u0628\u0647 \u0637\u0648\u0631 \u0628\u0627\u0644\u0642\u0648\u0647 \u0646\u0627\u0634\u0646\u0627\u0633 \u0628\u0648\u062f\u0646 \u0634\u0645\u0627 \u0631\u0627 \u06a9\u0627\u0647\u0634 \u0645\u06cc\u200c\u062f\u0647\u0646\u062f";
    t[1532] = "When enabled, the referer (originating page) of your web requests will not be filtered, potentially reducing your anonymity";
    t[1533] = "\u0647\u0646\u06af\u0627\u0645\u06cc \u06a9\u0647 \u0641\u0639\u0627\u0644 \u0628\u0627\u0634\u062f\u060c \u0627\u0631\u062c\u0627\u0639 \u062f\u0647\u0646\u062f\u0647 (\u0635\u0641\u062d\u0647 \u0627\u0635\u0644\u06cc) \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0647\u0627\u06cc \u0648\u0628 \u0634\u0645\u0627 \u0641\u06cc\u0644\u062a\u0631 \u0646\u0645\u06cc \u0634\u0648\u062f \u0648 \u0628\u0647 \u0637\u0648\u0631 \u0628\u0627\u0644\u0642\u0648\u0647 \u0646\u0627\u0634\u0646\u0627\u0633 \u0628\u0648\u062f\u0646 \u0634\u0645\u0627 \u0631\u0627 \u06a9\u0627\u0647\u0634 \u0645\u06cc \u062f\u0647\u062f";
